import { useState } from "react";
import { useNavigate, Link } from "react-router-dom";

export default function Home(){
    // ✌️✌️✌️✌️✌️
    const [query, setQuery] = useState("");
    const [type, setType] = useState("users")
    const navigate = useNavigate();

    function handleQueryChange(e){
        setQuery(e.target.value);
    }

    function handleSubmit(e){
        e.preventDefault();

        navigate(`/search/${type}/${query}`);
    }

    return (
        <form onSubmit={handleSubmit}>
            <input onChange={handleQueryChange} value={query} type="text" required />

            <label htmlFor="posts">
                Posts
            </label>
            <input checked={type === "posts" ? true : false} onClick={()=>setType("posts")} type="radio" value="posts" name="type" />
            <label htmlFor="users">
                Users
            </label>
            <input checked={type === 'users' ? true : false} onClick={()=>setType("users")} type="radio" name="type" value="users" id="users" />

            <button type="submit">
                Submit
            </button>
        </form>

    );
}
